(103, 'Program Agropreneur Muda', 'http://www.fama.gov.my/en/pengenalan-program-agrepreneur-muda', '			Program ini diwujudkan di dalam perlaksananaan Rancangan Malaysia ke-11 (RMK-11) untuk golongan muda yang berumur di antara 18 hingga 40 tahun. Ianya bertujuan untuk membantu dan menggalakkan penglibatan golongan muda dalam bidang keusahawanan agro berasaskan semua aktiviti di dalam rantaian nilai sektor pertanian seperti tanaman, ternakan, perikanan, industri asas tani termasuk pemasaran, khidmat sokongan dan agropelancongan.', '2021-06-29', '2021-08-27', , 'Agriculture');
INSERT INTO `news` (`id`, `newsTitle`, `newsLink`, `newsDescription`, `startDate`, `endDate`, `image`, `category`) VALUES
(104, 'PERMOHONAN AGRO-YES AGROBANK: SYARAT & CARA PERMOHONAN SKIM PEMBIAYAAN AGROPRENEUR MUDA', 'https://www.jomsimpan.com/permohonan-agro-yes-agrobank/', 'Ushawan muda atau agropreneur muda yang ingin mendapatkan pembiayaan bagi menjalankan bidang pertanian, Agrobank Malaysia kini memperkenalkan satu skim bagi membantu agropreneur di Malaysia iaitu Skim Pembiayaan Agropreneur Muda atau Agro-Youth Entrepreneur Scheme (AGRO-YES).', '2021-06-23', '2021-06-30', , 'Agriculture');
