INSERT INTO `news` (`id`, `newsTitle`, `newsLink`, `newsDescription`, `startDate`, `endDate`, `image`, `category`) VALUES
(107, 'Discover Your True Talent With Heriot-Watts Youth Transformation Programme This July 2018', 'https://eduadvisor.my/articles/heriot-watt-university-malaysia-youth-transformation-programme-july-2018/', 'The programme is designed to help you identify and achieve your full potential in key areas of creativity, innovation, critical thinking and communication. Not only will you be able to hone in on your skills, but youll also learn how to use these skills to excel at university and in the workforce.', '2021-06-09', '2021-06-20', , 'Information Technology (IT)');
INSERT INTO `news` (`id`, `newsTitle`, `newsLink`, `newsDescription`, `startDate`, `endDate`, `image`, `category`) VALUES
(108, 'Exabytes Digitalise Penang for Youth  Empowering Malaysian Youths through Digitalisation By Kim -May 20, 2021226', 'https://www.exabytes.my/blog/exabytes-digitalise-penang-for-youths/', 'Exabytes Network Sdn Bhd and the Penang State Government with Penang Youth Development Cooperation (PYDC) has launched a digitalisation programme entitled Digitalise Penang for Youth Programme. The aim of this programme is to provide youth between the ages of 15-35 years old with the knowledge on how to succeed in the digital economy.', '2021-07-08', '2021-07-06', , 'Information Technology (IT)');
INSERT INTO `news` (`id`, `newsTitle`, `newsLink`, `newsDescription`, `startDate`, `endDate`, `image`, `category`) VALUES
(109, 'Micro Connector Programme', 'https://www.smecorp.gov.my/index.php/en/programmes1/2015-12-21-09-53-14/micro-connector-programme', '									The Micro Connector Programme is one of SME Corp. Malaysias continuous development initiatives for microenterprises and inclusive group including youth, women, B40 and others community in the country. The Programme aims to provide simplified early-stage assistance for microenterprises to set up and run a business as well as to train the inclusive group including youth, women, B40 and others community to gain new skillset for income generation through entrepreneurship.\r\n\r\n\r\nThe Programme is designed to complement the latest business ideas in the start-up ecosystem by focusing on new and upcoming market segments and creativity in doing business particularly for aspiring entrepreneurs.', '2021-06-16', '2021-07-09', , 'Information Technology (IT)');
